// import logo from './logo.svg';
import './Scripts.js';
import './App.css';

function App() {
  return (
    <div>
        <div className="base-perfil">
            <div className="d-flex">
                <div>
                    <div className="perfil">
                      <img className="user-avatar"
                      src={user.imageUrl}
                      alt={'Foto do' + user.name}
                      width={user.imageSize}
                      height={user.imageSize}
                      />
                      <div>
                        <h1>{user.name}</h1>
                        <p>{user.profile}</p>
                      </div>
                    </div>
                    <Menu />
                </div>
                <SeparatorList />
            </div>
            <Button />
        </div>
    </div>
  );
}

export default App;
